var colorScale = d3.scaleSequential((t) => d3.interpolateViridis(1 - t))
            .domain([0, 1]);

//var colorScale = d3.scaleSequential(d3.interpolateViridis)
//            .domain([0, 20])

    // Filter the data based on specific conditions
var filteredData = data.filter(function(d) {
        return d.reporter === "CRE" && d.compound === "aMSH" && d.dose === "low";
    });

filteredData.forEach(function(d) {
    var idWithUnderscore = '_' + d.pos;  // Assuming 'pos' is the correct key
    var circle = d3.select('#' + idWithUnderscore);

    // Apply the color using the scale
    circle.style('fill', colorScale(d.sens_score));

    // Mouse events for the tooltip
    circle.on('mouseover', function(event) {
        d3.select('#tooltip')
            .style('display', 'block')
            .style('left', (event.pageX + 10) + 'px') 
            .style('top', (event.pageY + 10) + 'px')
            .html('Position: ' + d.pos + '<br>Value: ' + d.n_lof);
    }).on('mouseout', function() {
        d3.select('#tooltip').style('display', 'none');
    });

    var text = d3.select('#' + idWithUnderscore + 't');
    text.on('mouseover', function(event) {
        d3.select('#tooltip')
            .style('display', 'block')
            .style('left', (event.pageX + 10) + 'px') 
            .style('top', (event.pageY + 10) + 'px')
            .html('Position: ' + d.pos + '<br>Value: ' + d.n_lof);
    }).on('mouseout', function() {
        d3.select('#tooltip').style('display', 'none');
    });

});
